(6, 0, '{\"vi\":\"Trung tri\\u1ec3n l\\u00e3m & h\\u1ed9i ngh\\u1ecb T\\u00e2n B\\u00ecnh\",\"en\":\"Tan Binh Exhibition & Convention Center ( TBECC)\",\"ja\":\"Reunification Palace & Saigon Notre-Dame Basilica  \",\"cn\":\"Reunification Palace & Saigon Notre-Dame Basilica  \"}', 'tan-binh-exhibition--convention-center-(-tbecc)', '{\"vi\":\"<p>C&aacute;ch kh&aacute;ch s\\u1ea1n 20 ph&uacute;t \\u0111i xe v&agrave; \\u0111&acirc;y l&agrave; trung t&acirc;m tri\\u1ec3n l&atilde;m cao c\\u1ea5p n\\u01a1i Qu&yacute; v\\u1ecb c&oacute; th\\u1ec3 tr&igrave;nh l&agrave;ng s\\u1ea3n ph\\u1ea9m \\u0111\\u1ebfn l\\u01b0\\u1ee3ng l\\u1edbn kh&aacute;ch h&agrave;ng ti\\u1ec1m n\\u0103ng t\\u1ea1i nhi\\u1ec1u s\\u1ef1 ki\\u1ec7n tir\\u1ec3n l&atilde;m qu\\u1ed1c t\\u1ebf kh&aacute;c nhau.<\\/p>\\r\\n\",\"en\":\"<p>Tan Binh Exhibition &amp; Convention Center ( TBECC) 20 minutes away from the hotel by car and this is premier exhibition facility where you can showcase your products to a wide range of potential clients in various international shows and events.<\\/p>\\r\\n\",\"ja\":\"<p>Also known as Reunification Palace, the Independence Palace was both the home, and the workplace, for the President of South Vietnam during the Vietnam War. Do you know that it was where the Vietnam War ended during the Fall of Saigon on 30th April 1975?<\\/p>\\r\\n\\r\\n<p>Officially known as Basilica of Our Lady of The Immaculate Conception, it was constructed in the late 19th century by the French colonists, it has two bell towers, which reach a towering height of 58 meters (190 feet)!<\\/p>\\r\\n\\r\\n<p>Saigon Central Post Office is a post office in the downtown Ho Chi Minh City, near Saigon Notre-Dame Basilica, the city&#39;s cathedral. The building was constructed when Vietnam was part of French Indochina in the late 19th century&hellip;<\\/p>\\r\\n\",\"cn\":\"<p>Also known as Reunification Palace, the Independence Palace was both the home, and the workplace, for the President of South Vietnam during the Vietnam War. Do you know that it was where the Vietnam War ended during the Fall of Saigon on 30th April 1975?<\\/p>\\r\\n\\r\\n<p>Officially known as Basilica of Our Lady of The Immaculate Conception, it was constructed in the late 19th century by the French colonists, it has two bell towers, which reach a towering height of 58 meters (190 feet)!<\\/p>\\r\\n\\r\\n<p>Saigon Central Post Office is a post office in the downtown Ho Chi Minh City, near Saigon Notre-Dame Basilica, the city&#39;s cathedral. The building was constructed when Vietnam was part of French Indochina in the late 19th century&hellip;<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-10-44-42777615091-thumbnail2-jpg.jpg', 'destination', 1, 1, 0, '2016-03-30 21:29:51', '2018-07-10 17:09:56', 1, '5_min', ''),
(7, 0, '{\"vi\":\"Ph\\u1ed1 T\\u00e0u (Ch\\u1ee3 L\\u1edbn)\",\"en\":\"China Town (Cho Lon)\",\"ja\":\"Union Square\",\"cn\":\"Shopping Mall \"}', 'china-town-(cho-lon)', '{\"vi\":\"<p>Khu n&agrave;y l&agrave; n\\u01a1i tr&uacute; ng\\u1ee5 c\\u1ee7a nhi\\u1ec1u c\\u01b0 d&acirc;n ng\\u01b0\\u1eddi Hoa v\\u1edbi nh\\u1eefng \\u0111\\u1eb7c t&iacute;nh v\\u0103n h&oacute;a \\u0111a d\\u1ea1ng v\\u1ec1 ng&ocirc;n ng\\u1eef s\\u1eed d\\u1ee5ng, l\\u1ef1a ch\\u1ecdn \\u1ea9m th\\u1ef1c v&agrave; c&aacute;ch h\\u1ecd l&agrave;m \\u0103n trong kinh doanh h&agrave;ng ng&agrave;y&hellip;.m\\u1ea5t 30 \\u0111i xe s\\u1ebd t\\u1edbi n\\u01a1i \\u0111&oacute;.<\\/p>\\r\\n\",\"en\":\"<p>This area is home for a great number of Chinese residents with rich cultural traits in terms of their language used, food choices and the way they do daily business operation&hellip;It takes 30 minutes by car to get there.<\\/p>\\r\\n\",\"ja\":\"<p>This area is home for a great number of Chinese residents with rich cultural traits in terms of their language used, food choices and the way they do daily business operation&hellip;It takes 30 minutes by car to get there.<\\/p>\\r\\n\",\"cn\":\"<p>This area is home for a great number of Chinese residents with rich cultural traits in terms of their language used, food choices and the way they do daily business operation&hellip;It takes 30 minutes by car to get there.<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-10-44-53508557699-thumbnail2-jpg.jpg', 'destination', 1, 2, 0, '2016-03-30 21:30:26', '2018-07-10 17:10:51', 1, '30_min', ''),
(8, 0, '{\"vi\":\"S\\u00e2n v\\u1eadn \\u0111\\u1ed9ng Ph\\u00fa Th\\u1ecd\",\"en\":\"Phu Tho Stadium\",\"ja\":\"Phu Tho Stadium\",\"cn\":\"Phu Tho Stadium\"}', 'phu-tho-stadium', '{\"vi\":\"<p>S&acirc;n v\\u1eadn \\u0111\\u1ed9ng Ph&uacute; Th\\u1ecd: l&agrave; \\u0111\\u1ecba \\u0111i\\u1ec3m g\\u1ea7n nh\\u1ea5t v\\u1edbi kh&aacute;ch s\\u1ea1n n\\u01a1i th\\u01b0\\u1eddng xuy&ecirc;n t\\u1ed5 ch\\u1ee9c nhi\\u1ec1u tr\\u1eadn \\u0111\\u1ea5u th\\u1ec3 thao c\\u0169ng nh\\u01b0 nh\\u1eefng show di\\u1ec5n kh&aacute;c. H&atilde;y li&ecirc;n h\\u1ec7 v\\u1edbi b\\u1ed9 ph\\u1eadn Concierge c\\u1ee7a L\\u1ec5 T&acirc;n \\u0111\\u1ec3 nh\\u1eadn th&ocirc;ng tin mua v&eacute;. N\\u01a1i \\u0111&acirc;y c&aacute;ch kh&aacute;ch s\\u1ea1n 5 km v&agrave; 10 ph&uacute;t \\u0111i xe.<\\/p>\\r\\n\",\"en\":\"<p>Phu Tho Stadium: this is the venue closest to the hotel where many sports games or performance shows are organized periodically. Information about how to buy tickets can be obtained from our concierge team of Front Desk. It is 05 km away and for 10 minutes to get there.<\\/p>\\r\\n\",\"ja\":\"<p>S&acirc;n v\\u1eadn \\u0111\\u1ed9ng Ph&uacute; Th\\u1ecd: l&agrave; \\u0111\\u1ecba \\u0111i\\u1ec3m g\\u1ea7n nh\\u1ea5t v\\u1edbi kh&aacute;ch s\\u1ea1n n\\u01a1i th\\u01b0\\u1eddng xuy&ecirc;n t\\u1ed5 ch\\u1ee9c nhi\\u1ec1u tr\\u1eadn \\u0111\\u1ea5u th\\u1ec3 thao c\\u0169ng nh\\u01b0 nh\\u1eefng show di\\u1ec5n kh&aacute;c. H&atilde;y li&ecirc;n h\\u1ec7 v\\u1edbi b\\u1ed9 ph\\u1eadn Concierge c\\u1ee7a L\\u1ec5 T&acirc;n \\u0111\\u1ec3 nh\\u1eadn th&ocirc;ng tin mua v&eacute;. N\\u01a1i \\u0111&acirc;y c&aacute;ch kh&aacute;ch s\\u1ea1n 5 km v&agrave; 10 ph&uacute;t \\u0111i xe.<\\/p>\\r\\n\",\"cn\":\"<p>S&acirc;n v\\u1eadn \\u0111\\u1ed9ng Ph&uacute; Th\\u1ecd: l&agrave; \\u0111\\u1ecba \\u0111i\\u1ec3m g\\u1ea7n nh\\u1ea5t v\\u1edbi kh&aacute;ch s\\u1ea1n n\\u01a1i th\\u01b0\\u1eddng xuy&ecirc;n t\\u1ed5 ch\\u1ee9c nhi\\u1ec1u tr\\u1eadn \\u0111\\u1ea5u th\\u1ec3 thao c\\u0169ng nh\\u01b0 nh\\u1eefng show di\\u1ec5n kh&aacute;c. H&atilde;y li&ecirc;n h\\u1ec7 v\\u1edbi b\\u1ed9 ph\\u1eadn Concierge c\\u1ee7a L\\u1ec5 T&acirc;n \\u0111\\u1ec3 nh\\u1eadn th&ocirc;ng tin mua v&eacute;. N\\u01a1i \\u0111&acirc;y c&aacute;ch kh&aacute;ch s\\u1ea1n 5 km v&agrave; 10 ph&uacute;t \\u0111i xe.<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-10-45-05427167140-thumbnail2-jpg.jpg', 'destination', 1, 3, 0, '2016-03-30 21:30:55', '2018-07-10 17:11:37', 1, '10_min', ''),
(9, 0, '{\"vi\":\"Ben Thanh Market\",\"en\":\"Ben Thanh Market\",\"ja\":\"Ben Thanh Market\",\"cn\":\"Ben Thanh Market\"}', 'ben-thanh-market', '{\"vi\":\"<p>Ch\\u1ee3 B\\u1ebfn Th&agrave;nh: l&agrave; ng&ocirc;i ch\\u1ee3 l\\u1edbn nh\\u1ea5t \\u1edf trung t&acirc;m Saigon n\\u01a1i m&agrave; Qu&yacute; kh&aacute;ch c&oacute; th\\u1ec3 t&igrave;m b\\u1ea5t k\\u1ef3 th\\u1ee9 g&igrave; t\\u1eeb h&agrave;ng h&oacute;a \\u0111\\u01a1n gi\\u1ea3n \\u0111\\u1ebfn nh\\u1eefng m&oacute;n qu&agrave; l\\u01b0u ni\\u1ec7m \\u0111a \\u0111\\u1ea1ng, ch\\u1ea5t l\\u01b0\\u1ee3ng cao.<\\/p>\\r\\n\",\"en\":\"<p>Ben Thanh Market: the biggest central market in downtown Saigon where You can find almost anything you need here, from basic supplies to souvenirs.<\\/p>\\r\\n\",\"ja\":\"<p>Ben Thanh Market: the biggest central market in downtown Saigon where You can find almost anything you need here, from basic supplies to souvenirs.<\\/p>\\r\\n\",\"cn\":\"<p>Ben Thanh Market: the biggest central market in downtown Saigon where You can find almost anything you need here, from basic supplies to souvenirs.<\\/p>\\r\\n\"}', '{\"vi\":\"\",\"en\":\"\",\"ja\":\"\",\"cn\":\"\"}', '2018-07-10-10-45-20214975523-thumbnail2-jpg.jpg', 'destination', 1, 4, 0, '2016-03-30 21:31:26', '2018-07-10 17:12:33', 1, '10_min', ''),
