INSERT INTO `hotels` (`id`, `name`, `slug`, `display_order`, `graded_star`, `email_info`, `email_sales`, `hotline`, `tel`, `fax`, `no_of_rooms`, `address`, `city`, `country`, `description`, `short_description`, `added_date`, `updated_date`, `updated_by`, `facilities`, `sports`, `location`, `cover_photo`, `status`, `promotion`, `logo1`, `logo2`, `lat`, `lng`, `special_offer`, `trip`) VALUES
(1, 'Pandora Hotel & Residences', 'pandora-hotel', 1, 4, 'info@pandorahotel.com.vn', 'info@pandorahotel.com.vn', '02838 634 847', '02838 634 847', '+84862907079', 80, '{\"vi\":\"Khu C, S\\u1ed1 10, \\u0110\\u01b0\\u1eddng 3\\/2, Ph\\u01b0\\u1eddng 12, Qu\\u1eadn 10\",\"en\":\"Block C, 10 Ba Thang Hai St, Ward 12, Dist 10\"}', '{\"vi\":\"Th\\u00e0nh ph\\u1ed1 H\\u1ed3 Ch\\u00ed Minh\",\"en\":\"Ho Chi Minh\"}', '{\"vi\":\"Vietnam\",\"en\":\"Vietnam\"}', '{\"vi\":\"<p>T\\u1ecda l\\u1ea1c y&ecirc;n b&igrave;nh sau tr\\u1ee5c \\u0111\\u01b0\\u1eddng 3 th&aacute;ng 2 s\\u1ea7m u\\u1ea5t, Kh&aacute;ch s\\u1ea1n Pandora \\u0111\\u01b0\\u1ee3c n&acirc;ng c\\u1ea5p to&agrave;n di\\u1ec7n v&agrave;o n\\u0103m 2018 n\\u1eb1m trong khu&ocirc;n vi&ecirc;n r\\u1ed9ng r&atilde;i c\\u1ee7a H\\u1ecdc Vi\\u1ec7n H&agrave;nh Ch&iacute;nh Qu\\u1ed1c Gia. Kh&aacute;ch s\\u1ea1n bao g\\u1ed3m 103 ph&ograve;ng v\\u1edbi phong c&aacute;ch thi\\u1ebft k\\u1ebf v\\u1eeba c\\u1ed5 \\u0111i\\u1ec3n v\\u1eeba hi\\u1ec7n \\u0111\\u1ea1i t\\u1ea1o n&ecirc;n m\\u1ed9t di\\u1ec7n m\\u1ea1o ki\\u1ebfn tr&uacute;c h&agrave;i h&ograve;a. \\u0110&acirc;y \\u0111\\u01b0\\u1ee3c xem l&agrave; l\\u1ef1a ch\\u1ecdn th&iacute;ch h\\u1ee3p \\u0111\\u1ec3 \\u0111&oacute;n ti\\u1ebfp kh&aacute;ch \\u0111\\u1ebfn l\\u01b0u tr&uacute; ngh\\u1ec9 ng\\u01a1i hay \\u0111i c&ocirc;ng t&aacute;c v&agrave; c\\u0169ng l&agrave; \\u0111\\u1ecba \\u0111i\\u1ec3m th\\u01b0 gi&atilde;n nh\\u1eb9 nh&agrave;ng sau nh\\u1eefng gi\\u1edd l&agrave;m vi\\u1ec7c m\\u1ec7t nh\\u1ecdc.<\\/p>\\r\\n\\r\\n<p>V\\u1edbi \\u0111\\u1ed9i ng\\u0169 nh&acirc;n vi&ecirc;n chuy&ecirc;n nghi\\u1ec7p, ch&uacute;ng t&ocirc;i lu&ocirc;n mang \\u0111\\u1ebfn cho Qu&yacute; kh&aacute;ch m\\u1ed9t d\\u1ecbch v\\u1ee5 t\\u1ed1t nh\\u1ea5t v\\u1edbi s\\u1ef1 th&acirc;n thi\\u1ec7n, c\\u1edfi m\\u1edf v&agrave; hi\\u1ebfu kh&aacute;ch.<\\/p>\\r\\n\\r\\n<p>D&ugrave; Qu&yacute; v\\u1ecb \\u0111ang \\u0111i c&ocirc;ng t&aacute;c hay ngh\\u1ec9 d\\u01b0\\u1ee1ng th&igrave; ch&uacute;ng t&ocirc;i v\\u1eabn tin ch\\u1eafc r\\u1eb1ng \\u0111&acirc;y s\\u1ebd l&agrave; l\\u1ef1a ch\\u1ecdn \\u01b0u ti&ecirc;n c\\u1ee7a Q&uacute;y v\\u1ecb.<\\/p>\\r\\n\\r\\n<div>K&iacute;nh ch&uacute;c Qu&yacute; kh&aacute;ch m\\u1ed9t k&igrave; ngh\\u1ec9 th\\u1eadt th&uacute; v\\u1ecb!<\\/div>\\r\\n\\r\\n<h3>V\\u1ecb tr&iacute;<\\/h3>\\r\\n\\r\\n<p>Kh&aacute;ch s\\u1ea1n Pandora&nbsp;t\\u1ecda l\\u1ea1c thu\\u1eadn ti\\u1ec7n t\\u1ea1i qu\\u1eadn 10 v\\u1edbi vi\\u1ec7c ti\\u1ebfp c\\u1eadn d\\u1ec5 d&agrave;ng c&aacute;c khu v\\u1ef1c nh\\u01b0 Nh&agrave; Thi \\u0110\\u1ea5u Ph&uacute; Th\\u1ecd, Trung t&acirc;m tri\\u1ec3n l&atilde;m &amp; h\\u1ed9i ngh\\u1ecb T&acirc;n B&igrave;nh, Ph\\u1ed1 T&agrave;u Ch\\u1ee3 L\\u1edbn, Ch\\u1ee3 \\u0111&ecirc;m Cao Th\\u1eafng v&agrave; Si&ecirc;u th\\u1ecb Satra. \\u0110\\u1ecba \\u0111i\\u1ec3m n&agrave;y c&aacute;ch ch\\u1ee3 B\\u1ebfn Th&agrave;nh 2.8 km \\u1edf trung t&acirc;m Saigon v&agrave; l&agrave; n\\u01a1i h\\u1ea7u h\\u1ebft c&aacute;c lo\\u1ea1i h&agrave;ng h&oacute;a \\u0111\\u01b0\\u1ee3c b&agrave;y b&aacute;n cho nhu c\\u1ea7u mua s\\u1eafm c\\u1ee7a Qu&yacute; kh&aacute;ch.<\\/p>\\r\\n\",\"en\":\"<p>Peacefully located behind the bustling Ba Thang Hai street with many busy business activities, Pandora Hotel &amp; Residences, spaciously and completely renovated in 2018 within the premise of National Academy of Public Administration, boasts 103 nicely-furnished rooms in both traditional and modern designs which create a new look with a harmonious combination of architectures where guests can fill with high energetic feelings on business while also relax at ease when needed after work.<\\/p>\\r\\n\\r\\n<div>The friendly service offered by its well-trained staffs was inspired by high dedication, passion and commitment on best quality giving all guests greatest comfort and enjoyment.\\r\\n<p>When you are here no matter on business or leisure we can assure this is certainly your home away from home.<\\/p>\\r\\nStay comfortably!<\\/div>\\r\\n\\r\\n<div class=\\\"txt-location\\\">\\r\\n<h3>Location:<\\/h3>\\r\\n\\r\\n<p>Pandora Hotel is proudly situated in district 10 with easy access to Phu Tho Stadium, Tan Binh Exhibition and Convention Center (TBECC), China Town, Cao Thang Street Food Market and Satra Supermarket. The location is 2.8 away from Ben Thanh Market in downtown Saigon where almost all goods are sold for your shopping demands.<\\/p>\\r\\n<\\/div>\\r\\n\"}', '{\"vi\":\"<p>T\\u1ecda l\\u1ea1c y&ecirc;n b&igrave;nh sau tr\\u1ee5c \\u0111\\u01b0\\u1eddng 3 th&aacute;ng 2 s\\u1ea7m u\\u1ea5t, Kh&aacute;ch s\\u1ea1n Pandora \\u0111\\u01b0\\u1ee3c n&acirc;ng c\\u1ea5p to&agrave;n di\\u1ec7n v&agrave;o n\\u0103m 2018 n\\u1eb1m trong khu&ocirc;n vi&ecirc;n r\\u1ed9ng r&atilde;i c\\u1ee7a H\\u1ecdc Vi\\u1ec7n H&agrave;nh Ch&iacute;nh Qu\\u1ed1c Gia. Kh&aacute;ch s\\u1ea1n bao g\\u1ed3m 103 ph&ograve;ng v\\u1edbi phong c&aacute;ch thi\\u1ebft k\\u1ebf v\\u1eeba c\\u1ed5 \\u0111i\\u1ec3n v\\u1eeba hi\\u1ec7n \\u0111\\u1ea1i t\\u1ea1o n&ecirc;n m\\u1ed9t di\\u1ec7n m\\u1ea1o ki\\u1ebfn tr&uacute;c h&agrave;i h&ograve;a. \\u0110&acirc;y \\u0111\\u01b0\\u1ee3c xem l&agrave; l\\u1ef1a ch\\u1ecdn th&iacute;ch h\\u1ee3p \\u0111\\u1ec3 \\u0111&oacute;n ti\\u1ebfp kh&aacute;ch \\u0111\\u1ebfn l\\u01b0u tr&uacute; ngh\\u1ec9 ng\\u01a1i hay \\u0111i c&ocirc;ng t&aacute;c v&agrave; c\\u0169ng l&agrave; \\u0111\\u1ecba \\u0111i\\u1ec3m th\\u01b0 gi&atilde;n nh\\u1eb9 nh&agrave;ng sau nh\\u1eefng gi\\u1edd l&agrave;m vi\\u1ec7c m\\u1ec7t nh\\u1ecdc.<\\/p>\\r\\n\\r\\n<p>V\\u1edbi \\u0111\\u1ed9i ng\\u0169 nh&acirc;n vi&ecirc;n chuy&ecirc;n nghi\\u1ec7p, ch&uacute;ng t&ocirc;i lu&ocirc;n mang \\u0111\\u1ebfn cho Qu&yacute; kh&aacute;ch m\\u1ed9t d\\u1ecbch v\\u1ee5 t\\u1ed1t nh\\u1ea5t v\\u1edbi s\\u1ef1 th&acirc;n thi\\u1ec7n, c\\u1edfi m\\u1edf v&agrave; hi\\u1ebfu kh&aacute;ch.<\\/p>\\r\\n\\r\\n<p>D&ugrave; Qu&yacute; v\\u1ecb \\u0111ang \\u0111i c&ocirc;ng t&aacute;c hay ngh\\u1ec9 d\\u01b0\\u1ee1ng th&igrave; ch&uacute;ng t&ocirc;i v\\u1eabn tin ch\\u1eafc r\\u1eb1ng \\u0111&acirc;y s\\u1ebd l&agrave; l\\u1ef1a ch\\u1ecdn \\u01b0u ti&ecirc;n c\\u1ee7a Q&uacute;y v\\u1ecb.<\\/p>\\r\\n\\r\\n<div>K&iacute;nh ch&uacute;c Qu&yacute; kh&aacute;ch m\\u1ed9t k&igrave; ngh\\u1ec9 th\\u1eadt th&uacute; v\\u1ecb!<\\/div>\\r\\n\",\"en\":\"<p>Peacefully located behind the bustling Ba Thang Hai street with many busy business activities, Pandora Hotel &amp; Residences, spaciously and completely renovated in 2018 within the premise of National Academy of Public Administration, boasts 103 nicely-furnished rooms in both traditional and modern designs which create a new look with a harmonious combination of architectures where guests can fill with high energetic feelings on business while also relax at ease when needed after work.<\\/p>\\r\\n\\r\\n<div>The friendly service offered by its well-trained staffs was inspired by high dedication, passion and commitment on best quality giving all guests greatest comfort and enjoyment.\\r\\n<p>When you are here no matter on business or leisure we can assure this is certainly your home away from home.<\\/p>\\r\\nStay comfortably!<\\/div>\\r\\n\"}', '2016-03-29 21:54:52', '2018-10-30 16:15:23', 1, '', '', '', '', 0, '{\"vi\":null,\"en\":null}', '', '', '', '', '{\"vi\":\"<h3>Special Offers: Only Available at Homesite!<\\/h3>\\r\\n\\r\\n<p>(Valid for all bookings made via this website, stay date from now to 30&nbsp;September 2017)<\\/p>\\r\\n\\r\\n<p>1\\/ Free Airport pick-up service for all bookings for 05 consecutive nights (maximum 03 guests per room reserved).<\\/p>\\r\\n\\r\\n<p>2\\/ Free Airport pick-up and see off service for all bookings for 08 consecutive nights (maximum 03 guests per room reserved).<\\/p>\\r\\n\\r\\n<p>3\\/ Free Airport pick-up, see off service and daily laundry set per room for all bookings for 10 consecutive nights (maximum 03 guests per room reserved).<\\/p>\\r\\n\",\"en\":\"<h3>Special Offers: Only Available at Homesite!<\\/h3>\\r\\n\\r\\n<p>(Valid for all bookings made via this website, stay date from now to 30&nbsp;September 2018)<\\/p>\\r\\n\\r\\n<p>1\\/ Free Airport pick-up service for all bookings for 05 consecutive nights (maximum 03 guests per room reserved).<\\/p>\\r\\n\\r\\n<p>2\\/ Free Airport pick-up and see off service for all bookings for 08 consecutive nights (maximum 03 guests per room reserved).<\\/p>\\r\\n\\r\\n<p>3\\/ Free Airport pick-up, see off service and daily laundry set per room for all bookings for 10 consecutive nights (maximum 03 guests per room reserved).<\\/p>\\r\\n\"}', '');
