(45, '{\"en\":\"All rooms are fully equipped with high quality facilities and amenities creating a life experience of utmost comfort and convenience.<br\\/>\\r\\nA good feature is that all rooms have a balcony\",\"vi\":\"T\\u1ea5t c\\u1ea3 ph\\u00f2ng \\u0111\\u01b0\\u1ee3c trang b\\u1ecb \\u0111\\u1ea7y \\u0111\\u1ee7 trang thi\\u1ebft b\\u1ecb v\\u00e0 v\\u1eadt dung cao c\\u1ea5p t\\u1ea1o tr\\u1ea3i nghi\\u1ec7m tho\\u1ea3i m\\u00e1i nh\\u1ea5t cho du kh\\u00e1ch. \\u0110i\\u1ec3m c\\u1ed9ng l\\u00e0 t\\u1ea5t c\\u1ea3 c\\u00e1c ph\\u00f2ng \\u0111\\u1ec1u c\\u00f3 ban-c\\u00f4ng\",\"ja\":\"All rooms are fully equipped with high quality facilities and amenities creating a life experience of utmost comfort and convenience.<br\\/>\\r\\nA good feature is that all rooms have a balcony\",\"cn\":\"All rooms are fully equipped with high quality facilities and amenities creating a life experience of utmost comfort and convenience.<br\\/>\\r\\nA good feature is that all rooms have a balcony\"}', 'room_des', 1, 'Room Description', '0000-00-00 00:00:00', '2018-10-23 15:44:43', 1),
(47, '{\"en\":\"Our hotel is fully equipped with modern facilities and covers a wide range of services to perfectly meet basic to luxury demands of discerning travelers. The following outlets are ready at your use:\",\"vi\":\"Kh\\u00e1ch s\\u1ea1n c\\u1ee7a ch\\u00fang t\\u00f4i \\u0111\\u01b0\\u1ee3c trang b\\u1ecb \\u0111\\u1ea7y \\u0111\\u1ee7 v\\u00e0 hi\\u1ec7n \\u0111\\u1ea1i v\\u1edbi d\\u1ecbch v\\u1ee5 \\u0111a d\\u1ea1ng \\u0111\\u00e1p \\u1ee9ng t\\u1ed1t t\\u1eeb nhu c\\u1ea7u c\\u0103n b\\u1ea3n \\u0111\\u1ebfn cao c\\u1ea5p. Nh\\u1eefng b\\u1ed9 ph\\u1eadn sau lu\\u00f4n lu\\u00f4n s\\u1eb5n s\\u00e0ng ph\\u1ee5c v\\u1ee5 Qu\\u00fd kh\\u00e1ch:\",\"ja\":\"Our hotel is fully equipped with modern facilities and covers a wide range of services to perfectly meet basic to luxury demands of discerning travelers. The following outlets are ready at your use:\",\"cn\":\"Our hotel is fully equipped with modern facilities and covers a wide range of services to perfectly meet basic to luxury demands of discerning travelers. The following outlets are ready at your use:\"}', 'facilites', 1, 'Hotel Facilities', '0000-00-00 00:00:00', '2018-10-23 15:57:50', 1),
(46, '{\"en\":\"A wide variety of treatments offer different experiences which are created by our professional therapists who can help to calm your mind so you can surely rejuvenate after a hard working day. Single or double rooms are available for your need\",\"vi\":\"C\\u00e1c k\\u1ef9 thu\\u1eadt vi\\u00ean tr\\u1ecb li\\u1ec7u c\\u1ee7a ch\\u00fang t\\u00f4i v\\u1edbi nhi\\u1ec1u ph\\u01b0\\u01a1ng ph\\u00e1p lu\\u00f4n t\\u1ea1o \\u0111\\u01b0\\u1ee3c c\\u00e1c tr\\u1ea3i nghi\\u1ec7m kh\\u00e1c nhau \\u0111\\u1ec3 l\\u00e0m d\\u1ecbu nh\\u1eefng m\\u1ec7t m\\u1ecfi c\\u0103ng th\\u1eb3ng v\\u00e0  l\\u1ea5y l\\u1ea1i n\\u0103ng l\\u01b0\\u1ee3ng cho Qu\\u00fd v\\u1ecb sau m\\u1ed9t ng\\u00e0y l\\u00e0m vi\\u1ec7c m\\u1ec7t nho\\u00e0i. C\\u00f3 ph\\u00f2ng \\u0111\\u01a1n v\\u00e0 \\u0111\\u00f4i \\u0111\\u1ec3 Qu\\u00fd v\\u1ecb l\\u1ef1a ch\\u1ecdn ph\\u00f9 h\\u1ee3p v\\u1edbi nhu c\\u1ea7u\",\"ja\":\"A wide variety of treatments offer different experiences which are created by our professional therapists who can help to calm your mind so you can surely rejuvenate after a hard working day. Single or double rooms are available for your need\",\"cn\":\"A wide variety of treatments offer different experiences which are created by our professional therapists who can help to calm your mind so you can surely rejuvenate after a hard working day. Single or double rooms are available for your need\"}', 'aspa', 1, 'A Spa Description', '0000-00-00 00:00:00', '2018-07-12 11:41:57', 1),
(51, '{\"en\":\"Please contact us by clicking the \\\"Send Email\\\" button\",\"vi\":\"Vui l\\u00f2ng b\\u1ea5m v\\u00e0o n\\u00fat \\\"G\\u1edfi Email\\\" d\\u01b0\\u1edbi \\u0111\\u1ec3 li\\u00ean h\\u1ec7 v\\u1edbi ch\\u00fang t\\u00f4i\",\"ja\":\"Please contact us by clicking the \\\"Send Email\\\" button\",\"cn\":\"Please contact us by clicking the \\\"Send Email\\\" button\"}', 'contact1', 1, 'Text General Contact', '0000-00-00 00:00:00', '2018-07-16 15:16:01', 1),
(52, '{\"en\":\"As we highly value our guests any feedback will be much appreciated. Please contact us by filling the form below:\",\"cn\":\"As we highly value our guests any feedback will be much appreciated. Please contact us by filling the form below:\",\"ja\":\"As we highly value our guests any feedback will be much appreciated. Please contact us by filling the form below:\",\"vi\":\"Chúng tôi trân trọng tất cả Quý khách vì vậy mọi đóng góp ý kiến luôn được đanh giá cao. Vui lòng điền vào mẫu form bên dưới để liên hệ với chúng tôi.\"}', 'contact2', 1, 'Contact Form', '0000-00-00 00:00:00', '2018-07-15 15:20:37', 1),
(48, '{\"en\":\"For reservation or other enquiries, you can send us an email to <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> or check it out at <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\",\"vi\":\"\\u0110\\u1ec3 \\u0111\\u1eb7t ph\\u00f2ng ho\\u1eb7c c\\u00f3 c\\u00e2u h\\u1ecfi kh\\u00e1c Qu\\u00fd v\\u1ecb c\\u00f3 th\\u1ec3 g\\u1edfi email \\u0111\\u1ebfn <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> ho\\u1eb7c truy c\\u1eadp website <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\",\"ja\":\"For reservation or other enquiries, you can send us an email to <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> or check it out at <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\",\"cn\":\"For reservation or other enquiries, you can send us an email to <a href=\\\"mailto:info@pandorahotel.com.vn\\\">info@pandorahotel.com.vn<\\/a> or check it out at <a href=\\\"http:\\/\\/www.pandorahotel.com.vn\\\">www.pandorahotel.com.vn<\\/a>\"}', 'contact', 1, 'Contact Us', '0000-00-00 00:00:00', '2018-10-24 08:51:45', 1),
(49, '{\"en\":\"Please contact us to get special offer\",\"vi\":\"H\\u00e3y li\\u00ean l\\u1ea1c v\\u1edbi ch\\u00fang t\\u00f4i \\u0111\\u1ec3 c\\u00f3 gi\\u00e1 t\\u1ed1t nh\\u1ea5t\"}', 'special_offers', 1, 'Special Offers', '0000-00-00 00:00:00', '2018-10-28 22:25:07', 1),
(50, '{\"en\":\"Pandora Hotel is proudly situated in district 10 with easy access to Phu Tho Stadium, Tan Binh Exhibition and Convention Center (TBECC), China Town, Cao Thang Street Food Market and Satra Supermarket. The location is 2.8 away from Ben Thanh Market in downtown Saigon where almost all goods are sold for your shopping demands\",\"vi\":\"Kh\\u00e1ch s\\u1ea1n Pandora t\\u1ecda l\\u1ea1c t\\u1ea1i trung t\\u00e2m qu\\u1eadn 10, n\\u01a1i ti\\u1ebfp c\\u1eadn d\\u1ec5 d\\u00e0ng khu v\\u1ef1c l\\u00e2n c\\u1eadn nh\\u01b0 Nh\\u00e0 h\\u00e1t H\\u00f2a B\\u00ecnh (300 m), Vi\\u1ec7t Nam Qu\\u1ed1c T\\u1ef1 (400 m),  Trung t\\u00e2m ti\\u1ec7c c\\u01b0\\u1edbi Capella ( 800 m), Ga S\\u00e0iG\\u00f2n ( 1.5 km), Nh\\u00e0 Thi \\u0110\\u1ea5u Ph\\u00fa Th\\u1ecd, Trung t\\u00e2m tri\\u1ec3n l\\u00e3m & h\\u1ed9i ngh\\u1ecb T\\u00e2n B\\u00ecnh, Ph\\u1ed1 Ng\\u01b0\\u1eddi Hoa-Ch\\u1ee3 L\\u1edbn, Ch\\u1ee3 \\u0111\\u00eam Cao Th\\u1eafng v\\u00e0 Si\\u00eau th\\u1ecb Satra. V\\u1ecb tr\\u00ed kh\\u00e1ch s\\u1ea1n ch\\u1ec9 c\\u00e1ch ch\\u1ee3 B\\u1ebfn Th\\u00e0nh 2.5 km \\u1edf trung t\\u00e2m S\\u00e0i G\\u00f2n v\\u00e0 l\\u00e0 n\\u01a1i h\\u1ea7u h\\u1ebft c\\u00e1c lo\\u1ea1i h\\u00e0ng h\\u00f3a \\u0111\\u01b0\\u1ee3c b\\u00e0y b\\u00e1n cho nhu c\\u1ea7u mua s\\u1eafm c\\u1ee7a Qu\\u00fd kh\\u00e1ch.\"}', 'destination', 1, 'Destination', '0000-00-00 00:00:00', '2018-10-28 22:39:43', 1),
(53, '\"{\\\"en\\\":\\\"How to get there:<br\\/>\\r\\n<strong>From Tan Son Nhat International <\\/strong><br\\/>Go out to Truong Son Street, continue to Tran Quoc Hoan and turn left to Hoang Van Thu, then go along Nam Ky Khoi Nghia until you reach the intersection with Vo Thi Sau, then turn right and go straight on Vo Thi Sau passing a few intersections until you reach Dan Chu ( Democracy Square) Roundabout, then exit to 3 Thang 2 Street and go straight until you locate the hotel at Section C, #10, 3 thang 2 street, ward 12, District 10, Ho Chi Minh City- National Institute of Administration HCM City\\\",\\\"vi\\\":\\\"H\\u01b0\\u1edbng d\\u1eabn \\u0111\\u01b0\\u1eddng<br\\/><strong>T\\u1eeb s\\u00e2n bay T\\u00e2n S\\u01a1n Nh\\u1ea5t:<\\/strong><br\\/>Ra \\u0111\\u01b0\\u1eddng Tr\\u01b0\\u1eddng S\\u01a1n, \\u0111i ti\\u1ebfp \\u0111\\u1ebfn Tr\\u1ea7n Qu\\u1ed1c Ho\\u00e0n v\\u00e0 qu\\u1eb9o tr\\u00e1i ra Ho\\u00e0ng V\\u0103n Th\\u1ee5, sau \\u0111\\u00f3 \\u0111i d\\u1ecdc Nam K\\u1ef3 Kh\\u1edfi Ngh\\u0129a \\u0111\\u1ebfn khi g\\u1eb7p ng\\u00e3 t\\u01b0 v\\u1edbi V\\u00f5 Th\\u1ecb S\\u00e1u, qu\\u1eb9o ph\\u1ea3i v\\u00e0 \\u0111i th\\u1eb3ng tr\\u00ean V\\u00f5 Th\\u1ecb S\\u00e1u qua v\\u00e0i c\\u00e1i ng\\u00e3 t\\u01b0 \\u0111\\u1ebfn khi g\\u1eb7p v\\u00f2ng xoay C\\u00f4ng Tr\\u01b0\\u1eddng D\\u00e2n Ch\\u1ee7, sau \\u0111\\u00f3 tho\\u00e1t v\\u00f2ng xoay \\u0111\\u1ec3 ra \\u0111\\u01b0\\u1eddng 3 th\\u00e1ng 2 cho \\u0111\\u1ebfn khi t\\u00ecm \\u0111\\u01b0\\u1ee3c Kh\\u00e1ch s\\u1ea1n t\\u1ea1i Khu C, S\\u1ed1 10 \\u0110\\u01b0\\u1eddng 3\\/2, Ph\\u01b0\\u1eddng 12, Qu\\u1eadn 10, Tp.HCM - H\\u1ecdc Vi\\u1ec7n H\\u00e0nh Ch\\u00ednh Qu\\u1ed1c Gia TP.HCM\\\"}\"', 'contact3', 1, 'Chi duong', '0000-00-00 00:00:00', '2018-10-24 09:08:20', 1);
